  return (
      <BrowserRouter>
          <div className="App">
              <Routes>
                  <Route path="/login" component={<Login/>}> Hola</Route>
                  <Route path="/profile" component={<Profile/>}> chao</Route>
              </Routes>
              <Login/>
          </div>
      </BrowserRouter>

  );
}

export default App;
